/* Show the matrix. If snapshot = true, only shwo the first 5 * 5 corner. */
void peek(int row, int col, float *matrix, bool snapshot)
{
    for (int i = 0; i < (snapshot && row > 5 ? 5 : row); i++)
    {
        for (int j = 0; j < (snapshot && col > 5 ? 5 : col); j++)
        {
            cout << std::fixed << matrix[i * col + j] << "\t";
        }
        if (col > 5 && snapshot)
        {
            cout << "...";
        }
        cout << std::endl;
    }
    if (row > 5 && snapshot)
    {
        cout << "...";
    }
    cout << std::endl;
}

void convolve(queue &q, int channel, int height, int width, float *layer_in, int filter_d, int filter_s, float *filter, float *filter_biases, float *layer_out)
{

    buffer input_b(layer_in, range(channel, height, width));
    buffer filter_b(filter, range(filter_d * channel, filter_s, filter_s));
    buffer bias_b(filter_biases, range(filter_d));
    buffer output_b(layer_out, range(filter_d, height, width));

    q.submit([&](auto &h)
             {
        accessor input_a(input_b, h, read_only);
        accessor filter_a(filter_b, h, read_only);
        accessor bias_a(bias_b, h, read_only);
        accessor output_a(output_b, h, write_only);
        h.parallel_for(range(filter_d, height, width), [=](auto index) {
            float sum = 0.0f;
            for (int c = 0; c < channel; c++) {
                for (int i = - filter_s / 2; i <= filter_s / 2; i++) {
                    for (int j = - filter_s / 2; j <= filter_s / 2; j++) {
                        if (index[1] + i < height && index[2] + j < width) {
                            sum += filter_a[index[0] * channel + c][i + filter_s / 2][j + filter_s / 2] * input_a[c][index[1] + i][index[2] + j];
                        }
                    }
                }
            }
            output_a[index] = sum + bias_a[index[0]]; 
        }); });
}

void relu(queue &q, int size, float *layer_in, float *layer_out)
{
    buffer input_b(layer_in, range(size));
    buffer output_b(layer_out, range(size));
    q.submit([&](auto &h)
             {
      accessor input_a(input_b, h, read_only);
      accessor output_a(output_b, h, write_only);

      h.parallel_for(range(size), [=](auto i) {
        output_a[i] = input_a[i] >= 0.0 ? input_a[i] : 0.0;
      }); });
}
// assume stride of 2 and even input width and height
void max_pool(queue &q, int channel, int height, int width, float *layer_in, float *layer_out)
{
    const int new_height = height / 2;
    const int new_width = width / 2;
    {
        buffer input_b(layer_in, range(channel, height, width));
        buffer output_b(layer_out, range(channel, new_height, new_width));
        q.submit([&](auto &h)
                 {
      accessor input_a(input_b, h, read_only);
      accessor output_a(output_b, h, write_only);

      h.parallel_for(range(channel, new_height, new_width), [=](auto index) {
        float max_val = input_a[index];
        max_val = sycl::max(max_val, input_a[index[0]][index[1]+1][index[2]]);
        max_val = sycl::max(max_val, input_a[index[0]][index[1]][index[2]+1]);
        max_val = sycl::max(max_val, input_a[index[0]][index[1]+1][index[2]+1]);
        output_a[index] = max_val;
      }); });
    }
}

void l2_distance(queue &q, int channel, int length, float *layer_in, int d, float *prototypes, float *layer_out)
{
    {
        buffer input_b(layer_in, range(channel, length));
        buffer proto_b(prototypes, range(d, channel));
        buffer output_b(layer_out, range(d, length));
        q.submit([&](auto &h)
                 {
      accessor input_a(input_b, h, read_only);
      accessor proto_a(proto_b, h, read_only);
      accessor output_a(output_b, h, write_only);

      h.parallel_for(range(d, length), [=](auto index) {
        float sum = 0.0f;
        for (int c = 0; c < channel; c++) {
          sum += (input_a[c][index[1]] - proto_a[index[0]][c]) * (input_a[c][index[1]] - proto_a[index[0]][c]);
        }
        output_a[index] = sqrt(sum);
      }); });
    }
}

void distance_2_similarity(queue &q, int length, float *vector, float *result) {
  {
    buffer v_buf(vector, range(length));
    buffer r_buf(result, range(length));
    q.submit([&](auto &h) {
      accessor v(v_buf, h, read_only);
      accessor r(r_buf, h, write_only);

      h.parallel_for(range(length), [=](auto index) {
        r[index] = log((v[index] + 1) / (v[index] + 0.0001));
      });
    });
  }
}

void top9(queue &q, int channel, int length, float *tensor, float *result)
{
    {
        buffer m_buf(tensor, range(channel, length));
        buffer r_buf(result, range(channel, 9));
        q.submit([&](auto &h)
                 {
      accessor m(m_buf, h, read_only);
      accessor r(r_buf, h);

      h.parallel_for(range(channel), [=](auto index) {
        for (int i = 0; i < 9; i++) {
          r[index][i] = m[index][i];
          int k = i;
          while (true) {
            if (r[index][k] >= r[index][k / 2]) break;
            float temp = r[index][k];
            r[index][k] = r[index][k / 2];
            r[index][k / 2] = temp;
            k /= 2;
          }
        }

        for (int i = 9; i < length; i++) {
          if (m[index][i] > r[index][0]) {
            r[index][0] = m[index][i];
            int k = 0;
            while (k < 9) {
              if (k >= 4) break;

              if (r[index][k] > r[index][2 * k + 1] || r[index][k] > r[index][2 * k + 2]) {
                float temp = r[index][k];
                if (r[index][2 * k + 1] < r[index][2 * k + 2]) {
                  r[index][k] = r[index][2 * k + 1];
                  r[index][2 * k + 1] = temp;
                  k = 2 * k + 1;
                } else {
                  r[index][k] = r[index][2 * k + 2];
                  r[index][2 * k + 2] = temp;
                  k = 2 * k + 2;
                }
              } else {
                break;
              }
            }
          }
        }
      }); });
    }
}

void average(queue &q, int chn, int length, float *tensor, float *result)
{
    {
        buffer m_buf(tensor, range(chn, length));
        buffer r_buf(result, range(chn));

        q.submit([&](auto &h)
                 {
      accessor m(m_buf, h, read_only);
      accessor r(r_buf, h, write_only);

      h.parallel_for(range(chn), [=](auto index) {
        float sum = 0;
        for (int i = 0; i < length; i++) {
          sum += m[index][i];
        }
        r[index] = sum / length;
      }); });
    }
}

void fully_connected(queue &q, int c_in, int c_out, float *vector,
                     float *weights, float *result)
{
    buffer v_buf(vector, range(c_in));
    buffer w_buf(weights, range(c_out, c_in));
    buffer r_buf(result, range(c_out));
    q.submit([&](auto &h)
             {
      accessor v(v_buf, h, read_only);
      accessor w(w_buf, h, read_only);
      accessor r(r_buf, h, write_only);

      h.parallel_for(range(c_out), [=](auto index) {
        float sum = 0.0f;
        for (int i = 0; i < c_in; i++) {
          sum += v[i] * w[index][i];
        }
        r[index] = sum;
      }); });
}

void bottom9(queue &q, int chn, int length, float *tensor, float *result)
{
    {
        buffer m_buf(tensor, range(chn, length));
        buffer r_buf(result, range(chn, 9));
        q.submit([&](auto &h)
                 {
      accessor m(m_buf, h, read_only);
      accessor r(r_buf, h);

      h.parallel_for(range(chn), [=](auto index) {
        for (int i = 0; i < 9; i++) {
          r[index][i] = m[index][i];
          int k = i;
          while (true) {
            if (r[index][k] <= r[index][k / 2]) break;
            float temp = r[index][k];
            r[index][k] = r[index][k / 2];
            r[index][k / 2] = temp;
            k /= 2;
          }
        }

        for (int i = 9; i < length; i++) {
          if (m[index][i] < r[index][0]) {
            r[index][0] = m[index][i];
            int k = 0;
            while (k < 9) {
              if (k >= 4) break;

              if (r[index][k] < r[index][2 * k + 1] || r[index][k] < r[index][2 * k + 2]) {
                float temp = r[index][k];
                if (r[index][2 * k + 1] > r[index][2 * k + 2]) {
                  r[index][k] = r[index][2 * k + 1];
                  r[index][2 * k + 1] = temp;
                  k = 2 * k + 1;
                } else {
                  r[index][k] = r[index][2 * k + 2];
                  r[index][2 * k + 2] = temp;
                  k = 2 * k + 2;
                }
              } else {
                break;
              }
            }
          }
        }
      }); });
    }
}

void upsample4(queue &q, int chn, int row, int col, float *matrix, float *result)
{
    {
        buffer m_buf(matrix, range(chn, row, col));
        buffer r_buf(result, range(chn, row * 4, col * 4));

        q.submit([&](auto &h)
                 {
      accessor m(m_buf, h, read_only);
      accessor r(r_buf, h, write_only);

      h.parallel_for(range(chn), [=](auto index) {
        auto _r = 2 * (index[1] % 8) + 1;
        auto _q = (index[1] + 2) / 4;
        for (int i = 0; i < 2; i++) {
          for (int j = 0; j < 2; j++){
            r[index][i][j] = m[index][0][0];
            r[index][i][4 * col - 1 - j] = m[index][0][col - 1];
            r[index][4 * row - 1 - i][j] = m[index][row - 1][0];
            r[index][4 * row - 1 - i][4 * col - 1 - j] = m[index][row - 1][col - 1];
          }
        }
      }); });

        q.submit([&](auto &h)
                 {
      accessor m(m_buf, h, read_only);
      accessor r(r_buf, h, write_only);

      h.parallel_for(range(chn, col * 4 - 4), [=](auto index) {
        auto _r = 2 * (index[1] % 8) + 1;
        auto _q = (index[1] + 2) / 4;
        for (int i = 0; i < 2; i++) {
          r[index[0]][i][index[1] + 2] = (m[index[0]][0][_q] * (8 - _r) + m[index[0]][0][_q + 1] * _r) / 8;
          r[index[0]][4 * row - 1 - i][index[1] + 2] = (m[index[0]][row - 1][_q] * (8 - _r) + m[index[0]][row - 1][_q + 1] * _r) / 8;
          }
      }); });

        q.submit([&](auto &h)
                 {
      accessor m(m_buf, h, read_only);
      accessor r(r_buf, h, write_only);

      h.parallel_for(range(chn, row * 4 - 4), [=](auto index) {
        auto _r = 2 * (index[1] % 8) + 1;
        auto _q = (index[1] + 2) / 4;
        for (int i = 0; i < 2; i++) {
          r[index[0]][index[1] + 2][i] = (m[index[0]][_q][0] * (8 - _r) + m[index[0]][_q + 1][0] * _r) / 8;
          r[index[0]][index[1] + 2][4 * col - 1 - i] = (m[index[0]][_q][col - 1] * (8 - _r) + m[index[0]][_q + 1][col - 1] * _r) / 8;
        }
      }); });

        q.submit([&](auto &h)
                 {
      accessor m(m_buf, h, read_only);
      accessor r(r_buf, h, write_only);

      h.parallel_for(range(chn, row * 4 - 4, col * 4 - 4), [=](auto index) {
        auto _r1 = 2 * (index[1] % 4) + 1;
        auto _q1 = index[1] / 4;
        auto _r2 = 2 * (index[2] % 4) + 1;
        auto _q2 = index[2] / 4;
        r[index[0]][index[1] + 2][index[2] + 2]
            = (m[index[0]][_q1][_q2] * (8 - _r1) + m[index[0]][_q1 + 1][_q2] * _r1) * (8 - _r2) / 64
            + (m[index[0]][_q1][_q2 + 1] * (8 - _r1) + m[index[0]][_q1 + 1][_q2 + 1] * _r1) * _r2 / 64;
      }); });
    }
}

float *read_param(ifstream &rf)
{
    int len;
    rf.read((char *)(&len), 4);
    float *result = new float[len];
    rf.read((char *)result, len * 4);
    return result;
}

